import React from "react";

class EditFishForm extends React.Component {
    render() {
        return (
            <div className="fish-edit">
                <input type="text" name="name" onvalue={this.props.fish.name} />
                <input type="text" name="price" onvalue={this.props.fish.price} />
                <select type="text" name="status" onvalue={this.props.fish.status}>
                    <option value="available">Fresh!</option>
                    <option value="unavailable">Sold Out!</option>
                </select>
                <textarea name="desc" onvalue={this.props.fish.desc} />
                <input type="text" name="image" onvalue={this.props.fish.image} />
            </div>
        );
    }
}

export default EditFishForm;
